import React from 'react';
import { StyleSheet, Image, View } from 'react-native';
import Button from '../components/Button';
import Background from '../components/Background';
import { Text } from 'react-native-paper';


export default function RedoQuestionsScreen({ navigation }) {

    return (
    <Background>
        <View style={styles.container}>
            <Text style={styles.text}>
                        Now let's revisit the questions that you didn't get right on the first go.
            </Text>
            <Button
                        title="Continue"
                        onPress={() => {
                            // Add navigation logic to go back to the quiz screen or specific question screen
                            navigation.navigate('QuizScreen');
                        }}
                    />
                </View>
            </Background>
        );
    }

    const styles = StyleSheet.create({
        container: {
            flex: 1,
            justifyContent: 'center',
            alignItems: 'center',
        },
        text: {
            fontSize: 24,
            fontWeight: 'bold',
            marginBottom: 20,
            textAlign: 'center',
        },
    });
